import React from 'react';
import Gauge from 'react-gauge';

const TimeGauge = ({ totalMinutes, minutesTaken }) => {
  const percent = (minutesTaken / totalMinutes) * 100;

  return (
    <Gauge
      value={percent}
      width={200}
      height={160}
      label="Time taken"
      color="#67B7DC"
      backgroundColor="#eee"
      topLabelStyle={{ fontSize: '16px', fontWeight: 'bold' }}
      valueLabelStyle={{ fontSize: '24px' }}
      minMaxLabelStyle={{ fontSize: '16px' }}
    />
  );
};

export default TimeGauge;
